var L, nbSides, r, vOffset, curSlice, curSide, a, x, z;
L = thisComp.layer('Controller');
nbSides = L.effect('Layers Per Slice')(1);
r = L.effect('Radius')(1);
vOffset = L.effect('Vertical Offset')(1);
curSlice = Math.ceil(div(sub(index, parent.index), nbSides));
curSide = mod(sub(index, parent.index), nbSides);
a = degreesToRadians(div(360, nbSides));
x = mul(r, Math.cos(mul(a, curSide)));
z = mul(r, Math.sin(mul(a, curSide)));
$bm_rt = sum(value, [
    x,
    -(curSlice - 1) * (height + vOffset),
    z
]);

or.x:
var $bm_rt;
var L, nbSides, vOffset, curSlice, centerSlice;
L = thisComp.layer('Controller');
nbSides = L.effect('Layers Per Slice')(1);
vOffset = L.effect('Vertical Offset')(1);
curSlice = Math.ceil(div(sub(index, parent.index), nbSides));
centerSlice = [
    0,
    -(curSlice - 1) * (height + vOffset),
    0
];
$bm_rt = lookAt($bm_transform.position, centerSlice);

